/** @format */

import React, { Fragment } from 'react';
import { Grid } from '@mui/material';

import Dashboard from '../components/Dashboard';

const DashBoard = () => {
  return (
    <Fragment>
      <Grid
        component="main"
        spacing={3}
        sx={{
          height: '87vh',
          marginTop: '1px',
        }}
      >
        <Dashboard />
      </Grid>
    </Fragment>
  );
};

export default DashBoard;
